*
 * 获取三方授权用户信息，其中书旗Android支持"TAOBAO/WECHAT/SINA/ALIPAY/QQ"
 *
 * 支持平台：书旗Android、书旗iOS、天猫Android、天猫iOS、支付宝小程序
 *
 * @return {Promise.<void>}
 *
 * @example
 * libSQ.exec('get-third-part-user-info', {
 *   params: {
 *     type: 'TAOBAO',
 *   },
 * }).then((info) => {
 *   alert(`[get-third-part-user-info][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[get-third-part-user-info][error] ${JSON.stringify(err, null, 2)}`);
 * });

